import React from "react";

const e = React.createElement;
const consoleStyle = {
  width: "100%",
  height: 510,
  resize: "none",
  outline: "none"
};

class Console extends React.Component {


    componentWillMount() {
        this.setState({
          currentColor: this.props.console,
        });
    }


  render() {
    return e("textarea", {
      style: consoleStyle,
      defaultValue: this.state.console
    });
  }
}

export default Console;
